import { useState } from 'react';

function Home() {

   const [name, setName] = useState('mario')
   const [age, setAge] = useState('25')

    const handleClick = () => {
        setName("l")
        setAge('2')
    }

    return(
        <div className="home">
        <h2>Home</h2>
        <button onClick={handleClick}> click me</button>
        <p> {name} is {age}</p>
        </div>
    )
}

export default Home;
